import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Navbar from "../components/Navbar";
import Sidebar from "../components/Sidebar";
import API from "../api";

export default function StudentDashboard() {
  const [stats, setStats] = useState({
    totalAttempts: 0,
    bestScore: 0,
    bestQuiz: "N/A",
    averageScore: 0
  });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const res = await API.get("/quiz/user/submissions");
        const subs = res.data || [];

        if (subs.length === 0) return;

        const scores = subs.map(s => ({
          score: s.score,
          total: s.quiz?.questions?.length || 1,
          title: s.quiz?.title
        }));

        const best = scores.reduce((max, cur) => 
          (cur.score / cur.total) > (max.score / max.total) ? cur : max
        );

        const avg = scores.reduce((sum, s) => sum + (s.score / s.total), 0) / scores.length;

        setStats({
          totalAttempts: subs.length,
          bestScore: Math.round((best.score / best.total) * 100),
          bestQuiz: best.title,
          averageScore: Math.round(avg * 100)
        });
      } catch (err) {
        console.error(err);
      }
    };

    fetchStats();
  }, []);

  return (
    <>
      <Navbar />
      <div className="container-row">
        <Sidebar />
        <div className="content">
          <div className="card">
            <h2>Welcome Back!</h2>

            {/* Stats Cards */}
            <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(200px, 1fr))", gap: 20, margin: "30px 0" }}>
              <div style={{ background: "#1976d2", color: "white", padding: 20, borderRadius: 12, textAlign: "center" }}>
                <h2 style={{ margin: 0, fontSize: 42 }}>{stats.totalAttempts}</h2>
                <p style={{ margin: "8px 0 0" }}>Quizzes Attempted</p>
              </div>
              <div style={{ background: "#4caf50", color: "white", padding: 20, borderRadius: 12, textAlign: "center" }}>
                <h2 style={{ margin: 0, fontSize: 42 }}>{stats.bestScore}%</h2>
                <p style={{ margin: "8px 0 0" }}>Best Score</p>
                <small>{stats.bestQuiz}</small>
              </div>
              <div style={{ background: "#ff9800", color: "white", padding: 20, borderRadius: 12, textAlign: "center" }}>
                <h2 style={{ margin: 0, fontSize: 42 }}>{stats.averageScore}%</h2>
                <p style={{ margin: "8px 0 0" }}>Average Score</p>
              </div>
            </div>

            <div style={{ marginTop: 30, display: "flex", gap: 20, flexWrap: "wrap" }}>
              <Link to="/student/home">
                <button style={{ padding: "15px 30px", fontSize: 18 }}>Enter Quiz Code</button>
              </Link>
              <Link to="/profile">
                <button style={{ padding: "15px 30px", fontSize: 18, background: "#1976d2" }}>
                  View Full Profile
                </button>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
